title: set-custom-type
release_tracks:
- GA
summary:
# This summary is generated automatically on update and should not be edited.
- execute:
  - command: compute instances create $$instance$$ --zone us-central1-a
  - stderr: |-
      Created \[https://.*.googleapis.com/compute/v1/projects/cloud-sdk-integration-testing/zones/us-central1-a/instances/$$instance$$\].
      $
  - stdout: .*$$instance$$.*$
- execute:
  - command: compute instances stop $$instance$$ --zone us-central1-a
